import Task from "./Task";
import { FaArrowUp, FaArrowDown } from "react-icons/fa";
const Project = (
  tasks,
  project,
  onDelete,
  onToggle,
  showShort,
  onShow,
  onComplete
) => {
  console.log(project);
  return (
    <>
      <h2 onClick={onShow} style={{ background: "beige", color: "black" }}>
        {project.text}
        {showShort ? <FaArrowUp /> : <FaArrowDown />}
      </h2>

      {tasks.length > 0
        ? tasks.map(
            (task) =>
              showShort &&
              project.text ===
                task.type(
                  <Task
                    key={task.id}
                    task={task}
                    onDelete={onDelete}
                    onToggle={onToggle}
                    onComplete={onComplete}
                  ></Task>
                )
          )
        : showShort && <h3 style={{ marginLeft: "30px" }}>No Tasks</h3>}
    </>
  );
};

export default Project;
